import './index.css';

function Home() {
  return (
    <div id = "home">
      <ReactFileReader handleFiles={this.handleFiles} fileTypes={'.csv'}>
        <button className='btn'>Upload</button>
      </ReactFileReader>

      <output id="out">
          file contents will appear here
      </output>
    </div>
  );
}

export default Home;
